
-- STGAP00009533 - Business days difference calculation

/
CREATE OR REPLACE FUNCTION caps.Business_Days_Diff
     (v_Start_Date  IN DATE,
      v_End_Date    IN DATE)
RETURN NUMBER
IS
-- Returns the number of weekdays between 2 given dates inclusively
-- Returns 0 if end date is before start date or both start date and end date are weekend dates (saturday or sunday)
  Day_Count  NUMBER := 0;
  Curr_Date  DATE;
BEGIN -- loop through and update

  Curr_Date := v_Start_Date;

  WHILE Curr_Date <= v_End_Date LOOP
    IF To_Char(Curr_Date,'DY') NOT IN ('SAT',
                                       'SUN') THEN
      Day_Count := Day_Count + 1;
    END IF;
  
    Curr_Date := Curr_Date + 1;
  END LOOP;

  RETURN Day_Count;
END Business_Days_Diff;
/
grant execute on caps.Business_Days_Diff to public;


